import Express from 'express';
import React from 'react';
import ReactDOMServer from 'react-dom/server';

import * as Redux from "redux";
import * as ReactRedux from "react-redux";

var Scraper = require('../lib/Scraper');
var Data = require('../lib/Data')
// import HelloWorldList from '../common/containers/HelloWorldList'

import Day from '../common/components/Day'
import Neighborhood from '../common/components/Neighborhood'
import reducers from '../common/reducers'
// const store = Redux.createStore(reducers);

const app = Express();

var dataFilename = '/app/.data/trucks.json';
var data = new Data(dataFilename);

app.use(Express.static('public'));
app.get('/', (request, response) => {  
  data.getState((state) => {
    const store = Redux.createStore(reducers, state);
    const html = ReactDOMServer.renderToString(
      <ReactRedux.Provider store={store}>
        <div>
          <Day />
          <Neighborhood />
        </div>
      </ReactRedux.Provider>
    )

    const finalState = store.getState()
    response.send(renderFullPage(html, finalState))
  });
});

const renderFullPage = (html, preloadedState) => {
  return `
    <!doctype html>
    <html>
      <head>
        <title>Redux Universal Example</title>
      </head>
      <body>
        <div id="app">${html}</div>
        <script>
          window.__PRELOADED_STATE__ = ${JSON.stringify(preloadedState).replace(/</g, '\\x3c')}
        </script>
        <script src="/bundle.js"></script>
      </body>
    </html>
    `
}

app.get('/api/trucks/neighborhood/:neighborhoodId/day/:day/time/:time', data.getTrucksByNeighborhoodAndDay.bind(data));
app.get('/api/neighborhoods', data.getAllNeighborhoods.bind(data));
app.get('/api/days', data.getAllDays.bind(data));
app.get('/api/times', data.getAllTimes.bind(data));

app.get('/scrape', function (request, response) {
  var url = 'https://www.boston.gov/departments/small-business-development/city-boston-food-trucks-schedule';
  var scraper = new Scraper(url, dataFilename);
  scraper.scrape();
  response.send({scraped: true});
});


const listener = app.listen(process.env.PORT, () => {
  console.log("Your app is listening on port " + listener.address().port);
});

