import React from 'react'
import * as ReactRedux from 'react-redux'
import PropTypes from "prop-types";
import * as Actions from '../actions'

class Day extends React.Component {
  componentDidMount() {
    alert('did mount');
    const { dispatch } = this.props
    dispatch(Actions.fetchPostsIfNeeded('poops'));
  }

  render() {
    return (
      <div>
        <label htmlFor="day" onClick={this.props.click}>Day: </label>
        <select id="day" name="day" defaultValue={this.props.selected}>
          {this.props.list.map(day =>
            <option key={day.id} value={day.id}>{day.name}</option>
          )}
        </select>
      </div>
    )
  }
}
  /*
let Day = ({ selected, list, click }) => {
  return (
    <div>
      <label htmlFor="day" onClick={click}>Day: </label>
      <select id="day" name="day" defaultValue={selected}>
        {list.map(day =>
          <option key={day.id} value={day.id}>{day.name}</option>
        )}
      </select>
    </div>
  )
}*/

  // componentDidMount() {
  //   const { dispatch, selectedSubreddit } = this.props
  //   dispatch(fetchPostsIfNeeded(selectedSubreddit))
  // }

Day.propTypes = {
  selected: PropTypes.string.isRequired,
  list: PropTypes.array.isRequired,
  click: PropTypes.func.isRequired,
  dispatch: PropTypes.func.isRequired,
}

const mapStateToProps = (state) => ({
  selected: state.day.selected,
  list: state.day.list,
})
const mapDispatchToProps = (dispatch) => {
  return {
    click: () => {
      alert('clack');
      console.log('meh');
      dispatch(Actions.set(6));
    },
    dispatch: dispatch,
  }
}
Day = ReactRedux.connect(mapStateToProps, mapDispatchToProps)(Day)

export default Day

